import React, { Component } from "react";

import './scss/components/__ar.scss';

class ArtistPage extends Component {
    render() {
     
      return (
          <div className="artistpage_wrapper">
          <div className="top_page"></div>
          <p className="Artist_name">Artist Name<span>artist@email.com</span></p>
          <button className="view">View on Music Monitor</button>
   
     
          </div>
      )
    }
};
export default ArtistPage;
